import React, { useState } from 'react';

const App = () => {
    const [count, setCount] = useState(2);

    const incrementCount = () => {
        setCount(count + 1);
    };

    return (
        <div>
            <p>{count}</p>
            <button type="button" onClick={incrementCount}>
                Increment Count
            </button>
        </div>
    );
};
export default App;
